import React from 'react';

const Home = () => {
  return (
    <div>
      <h1>Welcome to E-Commerce Shop</h1>
      <h2>"Welcome to our online store!"</h2>
      <p>We are pleased to offer you a wide range of skin care, hair care and decorative cosmetics. Here you will find only high-quality products from trusted brands to highlight your beauty and give you confidence every day.</p>
      <h2>"Cosmetics created for you."</h2>
      <p>Our store is the place where your self-care story begins. We have collected a collection of products that meet the highest quality standards. Discover the world of beauty with unique offers, discounts and new products!</p>
      <p>In our cosmetics store, everyone will find something that will emphasize their individuality. Natural compositions, trendy shades and effective formulas - we have done everything to make you feel unique. Start your journey into the world of beauty right now!</p>
    </div>
  );
};

export default Home;
